import React from 'react';
import ReactDOM from 'react-dom';

import fname , {lname , mname} from './App';


ReactDOM.render(
  <>
    <h1>{fname}</h1>
    <h1>{lname}</h1>
    <h1>{mname}</h1>
  </>,
  document.getElementById('root')
)
